const wordsReducer = (state = initState, action) => {
    switch (action.type) {
        case SET_BLOCK_SELECTED:
            return {
                ...state, selectedBlock:action.selectedBlock
            }
            
        default:
            return state
    }
  
}

export const setBlockSelected = (selectedBlock) => ({type: SET_BLOCK_SELECTED, selectedBlock})
